count = gets.chomp.to_i

strings = []
1.upto(count) do
  strings << %^
^
end

results = []

strings.each do |string|
  pattern = string.split("")
  given = string.split("")
  total = given.size
  while given.any?
    given.shift
    counter = 0
    while given[counter] == pattern[counter]
      counter += 1
    end
    total += counter
  end
  puts total
end